// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    // <div className="App">
    //   <header className="App-header">
    //     <img src={logo} className="App-logo" alt="logo" />
    //     <p>
    //       Edit <code>src/App.js</code> and save to reload.
    //     </p>
    //     <a
    //       className="App-link"
    //       href="https://reactjs.org"
    //       target="_blank"
    //       rel="noopener noreferrer"
    //     >
    //       Learn React
    //     </a>
    //   </header>0
    // </div>
    <div className='app'>
      <h1 className='title'>Team Introduction</h1>
      {/* Person1 */}
      <div className='person-info'>
        <img className="img1" src="" alt="Person 1" width="100" height="100"></img>    
        <h4>Person1 name</h4>
        <ul>
          <li>Favourite hobby or activity you like to do (e.g., for downtime)</li>
          <li> Why do you do it? Why do you enjoy it?</li>
        </ul>
      </div>
      {/* Person2 */}
      <div className='person-info'>
        <img className="img2" src="" alt="Person 2" width="100" height="100"></img>    
        <h4>Person2 name</h4>
        <ul>
          <li>Favourite hobby or activity you like to do (e.g., for downtime)</li>
          <li> Why do you do it? Why do you enjoy it?</li>
        </ul>
      </div>
      {/* Person3 */}
      <div className='person-info'>
        <img className="img3" src="" alt="Person 3" width="100" height="100"></img>    
        <h4>Person3 name</h4>
        <ul>
          <li>Favourite hobby or activity you like to do (e.g., for downtime)</li>
          <li> Why do you do it? Why do you enjoy it?</li>
        </ul>
      </div>
      {/* Person4 */}
      <div className='person-info'>
        <img className="img4" src="" alt="Person 4" width="100" height="100"></img>    
        <h4>Person4 name</h4>
        <ul>
          <li>Favourite hobby or activity you like to do (e.g., for downtime)</li>
          <li> Why do you do it? Why do you enjoy it?</li>
        </ul>
      </div>
      {/* Person5 */}
      <div className='person-info'>
        <img className="img5" src="" alt="Person 5" width="100" height="100"></img>    
        <h4>Person5 name</h4>
        <ul>
          <li>Favourite hobby or activity you like to do (e.g., for downtime)</li>
          <li> Why do you do it? Why do you enjoy it?</li>
        </ul>
      </div>
      {/* Person6 */}
      <div className='person-info'>
        <img className="img6" src="/images/img6.jpg" alt="Person 6" width="100" height="100"></img>    
        <h4>Aga</h4>
        <ul>
          <li>My favorite hobbies are traveling, learning about architectural psychology, and exploring parametric design.</li>
          <li>These activities really open up my mind and make the world feel so much more exciting and full of possibilities!</li>
        </ul>
      </div>
    </div> 
  );
}

export default App;
